import React from 'react';
import './App.css';
import {Routes} from "react-router-dom";
import ProfileCard from "./projects/profileCard/ProfileCard";

function App() {
  return (
    <div className="App">
       <Routes path="profileCard" element={<ProfileCard/>}></Routes>
    </div>
  );
}

export default App;
